import React, { Component } from 'react';
let window = document.body.window.width
let port = [
  {
    "name":"RZ Drift",
    "description":"Mobile Racing Game",
    "imgurl":"images/portfolio/rz_drift_logo.jpeg",
    "link": "https://apps.apple.com/us/app/rz-drift/id1467063778"
  },
  {
    "name":"BattleThrones",
    "description":"Game of Thrones Themed Battleship",
    "imgurl":"images/portfolio/battlethrones.jpeg",
    "link": ""
  },
  {
    "name":"RZ Drift",
    "description":"Mobile Racing Game",
    "imgurl":"images/portfolio/rz_drift_logo.jpeg",
    "link": "https://apps.apple.com/us/app/rz-drift/id1467063778"
  },
  {
    "name":"RZ Drift",
    "description":"Mobile Racing Game",
    "imgurl":"images/portfolio/rz_drift_logo.jpeg",
    "link": "https://apps.apple.com/us/app/rz-drift/id1467063778"
  }
]
export default class Porfolio extends Component {
  render() {
    let grid = port.map((item,i) =>{
      return(
        <a href={item.link} target="_blank">
          <div>
            <img src={`${item.imgurl}`}/>
            <h1 className = "square">Hello I love u</h1>
          </div>
        </a>
        )
    })
    return (
      <section id="portfolio">
      <div>
        <div>
          <div className = "grid">
            {grid}
          </div>
        </div>
      </div>
  </section>
        );
  }
}
